Déanaimis tionscadal nua a chruthú ag baint úsáide as Cargo agus féachaint ar an difríocht atá idir é agus ár gcuid bunaidh "Dia duit, domhan!" tionscadal. Téigh ar ais chuig d'eolaire projects (nó cibé áit ar shocraigh tú do chód a stóráil). Ansin, ar aon chóras oibriúcháin, reáchtáil an méid seo a leanas: $ cargo new hello_cargo
$ cd hello_cargo Cruthaíonn an chéad ordú eolaire agus tionscadal nua ar a dtugtar hello_cargo . Tá ár dtionscadal ainmnithe againn mar hello_cargo , agus cruthaíonn Cargo a chomhaid in a eolaire den ainm céanna. Téigh isteach san eolaire hello_cargo agus liostaigh na comhaid. Feicfidh tú an Cargo sin tá dhá chomhad agus eolaire amháin ginte againn dúinn: comhad Cargo.toml agus a eolaire src le comhad main.rs istigh. Chuir sé tús le stór nua Git chomh maith le comhad .gitignore . Ní ghinfear comhaid Git má ritheann tú cargo new laistigh de Git atá ann cheana féin stór ; is féidir leat an t-iompar seo a shárú trí úsáid a bhaint as cargo new --vcs=git. Nóta: Is córas rialaithe leagan coitianta é Git. Is féidir leat cargo new a athrú go córas rialaithe leagan difriúil nó córas rialaithe leagan ar bith a úsáid trí úsáid a bhaint as an bhratach --vcs. Rith cargo new --help chun na roghanna atá ar fáil a fheiceáil. Oscail Cargo.toml i do rogha eagarthóir téacs. Ba chóir breathnú cosúil leis an cód i Liostú 1-2. [package]
name = "hello_cargo"
version = "0.1.0"
edition = "2021" # Féach tuilleadh eochracha agus a sainmhínithe ag https://doc.rust-lang.org/cargo/reference/manifest.html [dependencies] Tá an comhad seo sa TOML ( Tom Soiléir, Íosráta Language ) formáid, is é sin formáid chumraíochta Cargo. Is ceannteideal rannóige í an chéad líne, [package], a thugann le fios go bhfuil an ráitis seo a leanas ag chumrú pacáiste. De réir mar a chuirimid tuilleadh eolais le an comhad seo, cuirfimid ailt eile leis. Leagann na chéad trí líne eile an fhaisnéis chumraíochta a chaithfidh Cargo a thiomsú do chlár: an t-ainm, an leagan, agus an t-eagrán de Rust le húsáid. Labhróimid faoin eochair edition in Aguisín E . Is í an líne dheireanach, [dependencies], tús rannáin chun tú a liostú de spleáchais do thionscadal. I Rust, tagraítear do phacáistí cód mar crates . Ní bheidh aon cliathbhoscaí eile ag teastáil uainn don tionscadal seo, ach beidh muid sa an chéad tionscadal i gCaibidil 2, mar sin úsáidfimid an rannán spleáchais seo ansin. Anois oscail src/main.rs agus féach: Ainm comhaid: src/main.rs fn main() { println!("Dia duit, an domhan!");
} Tá Cargo tar éis "Dia duit, domhan!" clár duitse, díreach cosúil leis an gceann atá againn scríofa i Liostú 1-1! Go dtí seo, na difríochtaí idir ár dtionscadal agus an tionscadal Cargo ginte is ea gur chuir Cargo an cód san eolaire src agus tá comhad cumraíochta Cargo.toml againn san eolaire barr. Tá súil ag Cargo go mbeidh do chuid comhad foinse beo laistigh den eolaire src . Tá an níl eolaire tionscadail ardleibhéil ann ach do chomhaid README, faisnéis ceadúnais, comhaid cumraíochta, agus aon rud eile nach mbaineann le do chód. Ag baint úsáide as Cargo chuidíonn leat do thionscadail a eagrú. Tá áit do gach rud, agus tá gach rud ina áit. Má thosaigh tú ar thionscadal nach n-úsáideann Cargo, mar a rinne muid leis an "Dia duit, domhan!" tionscadal, is féidir leat é a thiontú go tionscadal a úsáideann Cargo. Bog an cód an tionscadail isteach san eolaire src agus cruthaigh Cargo.toml cuí comhad. Bealach éasca amháin chun an comhad Cargo.toml sin a fháil ná cargo init a rith, rud a cruthóidh sé duit go huathoibríoch é.
